import React, { Component } from "react";
import { Form, Grid, Input, Button } from "semantic-ui-react";
class change extends Component {
  // state = {  }

  render() {
    return (
      <Grid>
        <Grid.Row>
          <Form>
            <Grid.Column>
              <Form.Field>
                <label>First Name</label>
                <Input />
              </Form.Field>
            </Grid.Column>
            <Grid.Column>
              <Button type="submit">Submit</Button>
            </Grid.Column>
          </Form>
        </Grid.Row>
      </Grid>
    );
  }
}

export default change;
